webpackJsonp([87990403945100],{4786:function(n,a){n.exports={data:{markdownRemark:{html:'<h2>Object isFrozen</h2>\n<p>You can use <b><code>Object.isFrozen()</code></b> to figure out if an object is frozen or not. It returns a <b><code>true</code></b> or <b><code>false</code></b> boolean value. </p>\n<p><b><h4>SYNTAX</h4></b></p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>Object<span class="token punctuation">.</span><span class="token function">isFrozen</span><span class="token punctuation">(</span>obj<span class="token punctuation">)</span>\n</code></pre>\n      </div>\n<p><b>For Example:</b></p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token keyword">var</span> foods <span class="token operator">=</span> <span class="token punctuation">{</span>\n    grain <span class="token punctuation">:</span> <span class="token string">"wheat"</span><span class="token punctuation">,</span>\n    dairy  <span class="token punctuation">:</span> <span class="token string">"milk"</span><span class="token punctuation">,</span>\n    vegetable <span class="token punctuation">:</span> <span class="token string">"carrot"</span><span class="token punctuation">,</span>\n    fruit  <span class="token punctuation">:</span> <span class="token string">"grape"</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n<span class="token keyword">var</span> frozenFoods <span class="token operator">=</span> Object<span class="token punctuation">.</span><span class="token function">freeze</span><span class="token punctuation">(</span>foods<span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token keyword">var</span> areMyFoodsFrozen <span class="token operator">=</span> Object<span class="token punctuation">.</span><span class="token function">isFrozen</span><span class="token punctuation">(</span>frozenFoods<span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n\\\\ returns <span class="token boolean">true</span>\n</code></pre>\n      </div>\n<p>Remember, a frozen object <b>cannot</b> have its properties changed.\n</br></br>\nIf you try to use <b><code>Object.isFrozen()</code></b> on a non-object argument, it will return <code>true</code>. </p>\n<!-- The article goes here, in GitHub-flavored Markdown. Feel free to add YouTube videos, images, and CodePen/JSBin embeds  -->\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<p><a href=\'https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Object/isFrozen\' target=\'_blank\' rel=\'nofollow\'>MDN Object.isFrozen()</a></br>\n<a href=\'https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Object/freeze\' target=\'_blank\' rel=\'nofollow\'>MDN Object.freeze()</a></p>',fields:{slug:"/javascript/standard-objects/object/object-isfrozen/"},frontmatter:{title:"Object isFrozen"}}},pathContext:{slug:"/javascript/standard-objects/object/object-isfrozen/"}}}});
